// src/pages/AddTournamentPage.js

import React, { useState } from "react";
import axios from "axios";

export default function AddTournamentPage() {
  const [tournamentData, setTournamentData] = useState({
    name: "",
    sports: "",
    team_size: "",
    start_date: "",
    duration_days: "",
    logo_url: "",
    description: "",
    level: "",
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setTournamentData({ ...tournamentData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");

    try {
      const response = await axios.post(
        "http://localhost:5000/api/tournaments",
        tournamentData,
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`,
          },
        }
      );
      alert("Tournament created successfully!");
      // Redirect to tournaments list page or reset form
    } catch (err) {
      setError("Error creating tournament");
      console.error(err);
    }

    setLoading(false);
  };

  return (
    <div className="w-full max-w-lg mx-auto p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-bold text-center mb-4">Create Tournament</h2>

      {error && <div className="text-red-500">{error}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Tournament Name</label>
          <input
            type="text"
            name="name"
            value={tournamentData.name}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Sports</label>
          <input
            type="text"
            name="sports"
            value={tournamentData.sports}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Team Size</label>
          <input
            type="number"
            name="team_size"
            value={tournamentData.team_size}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Start Date</label>
          <input
            type="date"
            name="start_date"
            value={tournamentData.start_date}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Duration (Days)</label>
          <input
            type="number"
            name="duration_days"
            value={tournamentData.duration_days}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Logo URL</label>
          <input
            type="text"
            name="logo_url"
            value={tournamentData.logo_url}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Description</label>
          <textarea
            name="description"
            value={tournamentData.description}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-semibold mb-2">Level</label>
          <input
            type="text"
            name="level"
            value={tournamentData.level}
            onChange={handleInputChange}
            className="w-full p-2 border border-gray-300 rounded"
            required
          />
        </div>

        <div className="flex justify-center">
          <button
            type="submit"
            className="px-6 py-2 bg-athletiq-green text-white rounded-lg font-semibold"
            disabled={loading}
          >
            {loading ? "Creating..." : "Create Tournament"}
          </button>
        </div>
      </form>
    </div>
  );
}
